import React from "react";
import { useNavigate } from "react-router-dom";

function Home() {
    let navigate = useNavigate();
  return (
    <div className="Home">
      This is the home page.

      <button onClick={()=>{navigate("/work/:project")}}>Go to Canada150 case study</button>
    </div>
  );
}

export default Home;
